import{_ as A,o as v,c as g,V as s}from"./chunks/framework.7ae304b1.js";const d=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"network/mesh.md","filePath":"network/mesh.md"}'),a={name:"network/mesh.md"},B=s('<h2 id="家庭无线组网" tabindex="-1">家庭无线组网 <a class="header-anchor" href="#家庭无线组网" aria-label="Permalink to &quot;家庭无线组网&quot;">​</a></h2><p>由于生活水平对网络的需求提高，</p><p>优点：</p><p>可以做到同一个 WiFi 的名称（即同一个SSID），覆盖全屋，上网设备可以在不同设备之间自己自动的无缝切换，实现无缝漫游。</p><h2 id="ac-ap" tabindex="-1">AC+AP <a class="header-anchor" href="#ac-ap" aria-label="Permalink to &quot;AC+AP&quot;">​</a></h2><p>AC：Access Controller（接入控制器）</p><p>AP：Access Point（接入点）</p><p>优点：</p><p>使用稳定，可采用吸顶或面板式AP，美观度高，节省空间</p><p>缺点：</p><p>价格较高，需预铺设网线</p><h2 id="meth" tabindex="-1">Meth <a class="header-anchor" href="#meth" aria-label="Permalink to &quot;Meth&quot;">​</a></h2><p>Meth网络即“无线网格网络”，是“多跳（multi-hop）”网络<a href="./多跳网络：是一个动态的可以不断扩展的网络架构，实现无线设备之间的传输。由多个节点构造的，全部用无线连接到彼此，然后互相可以通过网络转发数据。数据从一个节点跳到另一个节点，直到抵达目的地。除非所有的节点都发生故障，否则数据总是可用的，如此使这种网络拓扑结构可靠且可扩展。.html">^1</a>，由Ad-Hoc网络发展而来。Meth的本质是AC+AP。</p><p>优点：</p><p>可扩展性高，且支持有线+无线混合组网，搭建较为便捷。</p><p>缺点：</p><p>每一个节点都需要配备电源，根据设备大小还需额外占用空间。</p><h3 id="分类" tabindex="-1">分类 <a class="header-anchor" href="#分类" aria-label="Permalink to &quot;分类&quot;">​</a></h3><p>根据连接方式，一般分为有线Meth、无线Meth和混合Meth三种；</p><h4 id="有线互联" tabindex="-1">有线互联 <a class="header-anchor" href="#有线互联" aria-label="Permalink to &quot;有线互联&quot;">​</a></h4><p>效果最好的Meth组网方案，要求也最高，需各个节点均铺设网线。</p><h4 id="无线互联" tabindex="-1">无线互联 <a class="header-anchor" href="#无线互联" aria-label="Permalink to &quot;无线互联&quot;">​</a></h4><p>经典Meth方案，可扩展性高，易于维护，但效果会因环境而波动。</p><h4 id="混合互联" tabindex="-1">混合互联 <a class="header-anchor" href="#混合互联" aria-label="Permalink to &quot;混合互联&quot;">​</a></h4><p>有线+无线组合方案，适用性最高，可根据实际情况调整。</p><h2 id="关键参数" tabindex="-1">关键参数 <a class="header-anchor" href="#关键参数" aria-label="Permalink to &quot;关键参数&quot;">​</a></h2><h3 id="wifi-6" tabindex="-1">WiFi 6 <a class="header-anchor" href="#wifi-6" aria-label="Permalink to &quot;WiFi 6&quot;">​</a></h3><p>目前最新一代的无线局域网（Wi-Fi）标准，即 IEEE 802.11ax。</p><h4 id="优势" tabindex="-1">优势 <a class="header-anchor" href="#优势" aria-label="Permalink to &quot;优势&quot;">​</a></h4><ol><li><p>速率更快：WiFi5最大传输速率为 3.5Gbps，而WiFi6最高速率可达 9.6Gbps，单流速率从之前 867Mbps 提升到1200Mbps。WiFi5只涉及5Ghz频段，而WiFi6覆盖了2.4Ghz、5Ghz两个频段。</p></li><li><p>更安全：WiFi 6（无线路由器）设备若需要通过WiFi联盟认证，必须采用WPA 3安全协议，安全性更高。WPA3安全协议安全性进一步提升，可以更好的阻止强力攻击，暴力破解等。</p></li><li><p>更省电：WiFi 6引入了 TARget Wake Time（TWT）技术，允许设备与无线路由器之间主动规划通信时间，减少无线网络天线使用及信号搜索时间，能够一定程度上减少电量消耗，提升设备续航时间。</p></li></ol><h3 id="支持meth组网" tabindex="-1">支持Meth组网 <a class="header-anchor" href="#支持meth组网" aria-label="Permalink to &quot;支持Meth组网&quot;">​</a></h3><p>Meth组网的全部配置都由设备本身预设，所以必须要选择支持Meth功能的设备。</p><h3 id="信号强度" tabindex="-1">信号强度 <a class="header-anchor" href="#信号强度" aria-label="Permalink to &quot;信号强度&quot;">​</a></h3><p>wifi信号强度一般在 -40dBm ~ -120dBm，正常使用范围在 -30dBm ~ -85dbm 之间，</p><p>-35dBm 基本等于无衰减，小于 -90dBm 则几乎不可用了。</p><h4 id="穿透损耗" tabindex="-1">穿透损耗 <a class="header-anchor" href="#穿透损耗" aria-label="Permalink to &quot;穿透损耗&quot;">​</a></h4><p><img src="data:image/png;base64," alt="image"></p><h2 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h2>',38),l=[B];function t(r,f,W,e,Y,w){return v(),g("div",null,l)}const u=A(a,[["render",t]]);export{d as __pageData,u as default};
